            <a href="https://de-de.facebook.com/hgsthenextones/" rel="noreferrer" target="_blank"><Icon icon="akar-icons:twitter-fill" height="40px" color="#fff" /></a>
            </div>

  <p><a style={footerStyle} href="https://vcard.miomideal.com" rel="noreferrer" target="_blank">Â© {YEAR} Mio Mideal </a></p>

  </div>
        </footer>
    </div>

    )
}
export default Footer;
